import React, { Component } from 'react';

export default class My extends Component{
    constructor(props){
        super(props)
        this.state = {
            count : 0
        }
    }
    render(){
        const {count} = this.state;
        return(
           <div>
                <h1>Count: {this.state.count}</h1>
           </div>
        )
    }
}
